export const listReducer = (state , action) => {
  switch (action.type) {
    case "ADD_TASK":
        console.log(state);
        console.log('payload - >>> ' , action.payload);
        return [...state, {wd:"wdsa"}]
        //return [...state , action.payload]
    default:
      return state;
  }
};
